COPY public.faq (faq_id, chatbot_id, pergunta, resposta, idioma, mostrar_nas_recomendacoes) FROM stdin;
66	1	É obrigatório o pagamento da propina?	Os estudantes matriculados nas escolas integradas no IPVC estão obrigados, nos termos da lei, ao pagamento de propinas.As propinas são integralmente devidas como contrapartida da matrícula/inscrição num determinado ano letivo do 1.º e dos 2.º ciclos, bem como dos CTeSP, independentemente do número de unidades curriculares em que o estudante se inscreva, excetuando-se os regimes especiais previstos para os estudantes em regime de tempo parcial.	PT	t
67	1	Posso solicitar um plano excecional de pagamento da propina?	Poderá ser autorizado um plano de pagamento faseado da propina em número de prestações superiores ao estipulado, desde que não ultrapasse, em caso algum, o dia 31 de julho do ano letivo em causa. Para esse efeito deverá dirigir-se ao Balcão Único da sua escola e obter informação do procedimento.	PT	t
68	1	Como procedo em relação ao pagamento da 1ª prestação da propina, se pretender concorrer aos benefícios sociais (bolsa de estudo)?	Os estudantes que requeiram bolsa de estudo poderão beneficiar de dilação do prazo de pagamento da propina, desde que apresentem, no momento da renovação da inscrição, documento comprovativo de candidatura emitido pelos Serviços de Ação Social (SAS).Afixados os resultados das candidaturas às bolsas de estudo, os estudantes que beneficiaram de dilação do prazo de pagamento da propina por se terem candidatado a bolsa de estudo dispõem de 10 dias, contados a partir do dia imediato ao da referida afixação, para efetuar o seu pagamento.	PT	f
69	1	Qual a forma do pagamento da propina para as restantes prestações (uma vez que a primeira prestação é paga no ato da matrícula/renovação)?	O pagamento da propina é efetuado através:SIBS/ATM – através da referência de pagamento disponibilizadas área pessoal de estudante IPVC, tendo em atenção ao valor e nos períodos definidos no Regulamento Geral de Propinas e Prescrição do IPVC.	PT	f
70	1	Se não efetuar o pagamento da propina no ato da matrícula, posso considerá-la válida?	No ato da matrícula/inscrição deverá, obrigatoriamente, efetuar o pagamento do seguro escolar, taxa de matrícula/inscrição e da 1ª prestação da propina. Caso não tenha recursos económicos para liquidar a 1ª prestação da propina e tenha efetuado candidatura a bolsa de estudos, poderá adiar o pagamento desta prestação até saída dos resultados das bolsas.	PT	f
71	1	Sou estudante a tempo parcial, terei de pagar a totalidade da propina?	O valor das propinas dos estudantes a tempo parcial é definido pelo Conselho Geral do IPVC.	PT	f
72	1	Quais as consequências do não pagamento de propinas?	O não pagamento de propinas no seu todo ou em parte até 31 de julho do ano letivo em causa, determina o vencimento de todas as prestações fixadas no ano letivo em causa, a nulidade de todos os atos curriculares e consequentemente a suspensão imediata da matrícula/inscrição, nos termos do Regulamento Geral de Propinas e Prescrição do IPVC no ano letivo a que o incumprimento da obrigação se reporta.O não pagamento de uma prestação dentro do prazo fixado, para além dos juros de mora referidos no n.º 3 do artigo 7.º do Regulamento Geral de Propinas e Prescrição do IPVC, implica sem necessidade de notificação prévia, a suspensão da matrícula e da inscrição, não podendo o estudante frequentar as aulas, apresentar -se a avaliação e utilizar os serviços prestados pelos Serviços de Ação Social, com a privação ainda do direito de acesso aos apoios sociais, até à regularização dos débitos acrescidos dos respetivos juros de mora, conforme a alínea b) do artigo 29.º da Lei n.º 37/2003, de 22 de agosto, alterada pela Lei n.º 49/2005, de 30 de agosto.	PT	f
73	1	À data da matrícula tenho propinas em dívida do ano anterior, será que sou penalizado?	Os estudantes que à data da matrícula e inscrição sejam devedores de uma ou mais prestações de propinas relativas a anos anteriores, devem efetuar o pagamento na totalidade no ato da matrícula/inscrição. Excecionalmente poderá apresentar um plano de pagamento faseado do valor em dívida a aprovar pelo Conselho de Gestão do IPVC, por forma a prosseguir com a renovação da inscrição.	PT	f
74	1	Emolumentos - Que atos académicos estão sujeitos ao pagamento de emolumentos?	A maioria dos atos académicos que estão sujeitos ao pagamento de emolumentos estão indicados na tabela emolumentos do IPVC publicada pelo Despacho n.º 9585/2020 de 2 de outubro.	PT	f
75	1	Emolumentos - São reembolsados os emolumentos pagos, se obtiver melhoria de nota no exame?	Do emolumento previsto na Revisão, reclamação e recursos de provas, o valor será devolvido se for obtida classificação mais elevada que a anteriormente obtida ou decisão mais favorável, desde que o requeiram nos 15 dias de calendário subsequentes à publicação do resultado.	PT	f
76	1	Emolumentos - Sou estudante bolseiro, tenho benefício de alguma redução?	Os estudantes bolseiros beneficiam de uma redução de 50 % nos emolumentos previstos, com exceção da penalidade prevista no ponto 9 da tabela de emolumentos definida.	PT	f
77	2	Como posso ter acesso às cantinas e bares?	As refeições e produtos de bar podem ser adquiridos nos kiosks de venda, junto aos bares, sendo a autenticação realizada através do cartão do IPVC. As refeições podem ainda ser adquiridas na app SASocial ou na pagina webOnde se localizam as cantinas dos SAS-IPVC?As cantinas localizam-se em cada uma das escolas superiores.Que tipo de refeições estão disponíveis?Prato de carnePrato de peixePrato vegetarianoSugestãoGrillExistem ainda refeições ligeiras como sopa, sandes e saladas disponíveis nos bares.	PT	f
78	2	Qual a composição da refeição?	Todas as refeições são constituídas por um prato de sopa, prato principal, pão, sobremesa (fruta ou doce) e água.	PT	f
79	2	Quem gere as unidades alimentares?	As unidades alimentares são geridas diretamente pelos SAS-IPVC.	PT	f
80	2	Como é determinado o preço da refeição social?	O preço máximo da refeição subsidiada no âmbito do sistema de ação social do ensino superior é fixado em 0,63 % do Indexante de Apoios Sociais em vigor no início de cada ano letivo, e automaticamente atualizado a 1 de outubro de cada ano civil.	PT	f
82	2	Quando posso apresentar a candidatura a alojamento?	A candidatura a alojamento decorre em duas fases:A primeira fase decorre no mês de junho e é destinada aos estudantes matriculados/inscritos no IPVC no ano letivo anterior que pretendam a renovação do alojamento ou que pretendam vir a ser alojados pela 1.ª vez;A segunda fase dercorre a partir do dia 1 de agosto nos 20 dias de calendário contados a partir da data da matricula;A candidatura pode ainda ser submetida fora dos prazos estabelecidos até ao dia 31 de maio, estando sujeita às vagas existentes.	PT	f
83	2	Para quantos anos é valida a candidatura?	Uma candidatura ao alojamento de um estudante só é válida para 1 ano letivo.	PT	f
81	2	Como posso efetuar a candidatura a alojamento?	As candidaturas a alojamento nas residências dos SAS-IPVC são efetuadas online na plataforma SASocial.	PT	t
85	2	Durante que período me é atribuído alojamento?	O alojamento é atribuído para o período de setembro a junho. Para beneficiar de alojamento nos meses de julho e agosto é necessário efetuar pedido de prolongamento na plataforma SASocial.	PT	f
86	2	Caso seja aceite, quando devo dar entrada?	O estudante que for colocado deve confirmar ou rejeitar a colocação no prazo de 5 dias e dar entrada nos 25 dias seguintes	PT	f
87	2	Sou estudante bolseiro com candidatura rejeitada por motivo de inexistência de vagas. Beneficio de algum complemento de alojamento?	Sim, pode beneficiar de complemento de alojamento até ao montante máximo previsto no Regulamento de Atribuição de Bolsas de Estudo a Estudantes do Ensino Superior.	PT	f
89	2	Como posso efetuar a candidatura à bolsa de apoio social?	A candidatura é efetuada através do preenchimento de um formulário online disponível em https://sasocial.sas.ipvc.pt/.NOTA – A colaboração nas ofertas disponíveis só pode ser efetuada após a manifestação de interesse e posterior comunicação de seleção através de entrevista.	PT	f
90	2	Como posso apresentar uma candidatura a bolsa de estudo?	O requerimento para atribuição de bolsa de estudo é submetido exclusivamente online, através da plataforma BeOn, disponível no seguinte link: https://www.dges.gov.pt/wwwBeOn/	PT	f
91	2	Qual o prazo para apresentar candidatura a bolsa de estudo?	A candidatura à atribuição de uma bolsa de estudo deve ser submetida:Entre 25 de junho e 30 de setembro;Nos 20 dias úteis subsequentes à inscrição, quando esta ocorra após 30 de setembro;Nos 20 dias úteis subsequentes à emissão de comprovativo de início de estágio por parte da entidade que o faculta, no caso de licenciados ou mestres que estejam a realizar estágio profissional.A candidatura pode ainda ser submetida entre 1 de outubro e 31 de maio, sendo que, nesse caso, o valor da bolsa de estudo a atribuir é proporcional ao valor calculado para um ano, considerando o período que medeia entre o mês seguinte ao da submissão do requerimento e o fim do período letivo ou do estágio.	PT	f
93	2	Que documentos devo apresentar na minha candidatura à atribuição de bolsa de estudo?	Para preencher o formulário de candidatura a bolsa de estudo, necessita ter consigo os seguintes documentos referentes a todos os elementos do agregado familiar:Cartão de Cidadão (NIF/NISS);Declaração de IRS do ano civil anterior ao início do ano letivo a que se refere a candidatura a bolsa de estudo;Saldo das contas bancárias, à ordem e a prazo, com a situação referente a 31 de dezembro do ano civil anterior ao início do ano letivo a que se refere a candidatura a bolsa de estudo e valor dos restantes bens móveis (certificados de aforro, ações, obrigações, planos poupança reforma, etc);Caso o agregado familiar seja detentor de participação em sociedades por quotas, deverá apresentar a Ata da Aprovação de Contas, certidão do registo comercial, DA IES e IRC ano civil anterior ao início do ano letivo a que se refere a candidatura a bolsa de estudo;Declaração do Imposto Municipal sobre Imóveis (IMI) ou a caderneta predial do imóvel utilizado como habitação própria e permanente do agregado familiar (caso o agregado possua habitação própria permanente);Caso a habitação seja com contrato de arrendamento, deverá retirar do portal das finanças na área do locatário (obter contrato);Caso a habitação seja com renda apoiada, deverá apresentar comprovativo do valor da renda anual apoiada;Caso seja habitação social, deverá apresentar o comprovativo da mesma;Comprovativo do IBAN (Número Internacional de Conta Bancária) com identificação do titular da conta onde pretende receber a bolsa de estudo.	PT	f
94	2	A quantos ECTS tenho de estar inscrito para efeitos de atribuição de bolsa de estudo?	Tem de estar inscrito no mínimo a 30 ECTS, salvo as exceções previstas no Regulamento de Atribuição de Bolsas de Estudo a Estudantes do Ensino Superior.	PT	f
95	2	O que é um agregado familiar para efeitos de bolsa de estudo?	O agregado familiar do estudante, é constituído pelo próprio e pelas seguintes pessoas que com ele vivam em comunhão de mesa, habitação e/ou rendimento:Cônjuge ou pessoa em união de facto do próprio ou de outro membro do agregado;Parentes e afins, em linha reta e em linha colateral, até ao 4.º grau;Adotantes, tutores e pessoas a quem o estudante esteja confiado por decisão judicial ou administrativa de entidades ou serviços legalmente competentes para o efeito;Adotados e tutelados pelo estudante ou por qualquer dos elementos do agregado familiar e crianças e jovens confiados, por decisão judicial ou administrativa de entidades ou serviços legalmente competentes para o efeito, ao estudante ou a qualquer dos elementos do agregado familiar;Afilhados e padrinhos, nos termos da Lei n.º 103/2009, de 11 de setembro.	PT	f
96	2	Sou aluno do IPVC, quem é responsável pela análise da minha candidatura a bolsa de estudo?	A análise dos pedidos de atribuição de bolsa de estudo e a elaboração da proposta de decisão competem aos Serviços de Ação Social do IPVC.	PT	f
97	2	Se anular a minha matrícula, até que mês terei direito a receber a bolsa de estudo?	Terá direito a bolsa de estudo até ao mês anterior ao da anulação de matrícula, salvo as exceções previstas na legislação em vigor.(n. º 3 do artigo 55.º do Regulamento de Atribuição de Bolsas de Estudo a Estudantes do Ensino Superior).	PT	f
98	2	O que é o Bus Académico?	É um serviço de transporte em autocarro, de baixo custo, que permite o transporte de e para as escolas do IPVC.	PT	f
99	2	Quais os transportes que posso utilizar com o passe mensal?	A modalidade de passe mensal permite beneficiar do transporte diário em carreiras de transporte públicos (Autoviação Melgaço, Courense e AVIC) e aceder, sem custo adicional, aos serviços de transportes urbanos de Viana do Castelo (Transcunha).Também pode viajar no Bus 1, Bus 2 e Bus 3.	PT	f
88	2	Quais são os requisitos para efetuar a candidatura à bolsa de apoio social?	São elegíveis para efeitos de acesso ao fundo de apoio social todos alunos matriculados no IPVC, quer sejam bolseiros ou não bolseiros.	PT	t
100	2	Qual é o período de funcionamento do bus académico?	Este serviço está interligado com o calendário das atividades letivas do IPVC. O serviço do bus académico é interrompido nas paragens letivas do Natal e da Páscoa, sendo cobrada apenas meia mensalidade nestes períodos.	PT	f
101	2	Como posso adquirir o passe mensal?	O registo no serviço do bus académico é efetuado através de um formulário de inscrição na plataforma SASocial.	PT	f
102	2	Como posso cancelar o serviço do bus académico?	O cancelamento ou suspensão provisória do passe mensal é solicitado na plataforma SASocial com, no mínimo, 30 dias de antecedência, devendo ter o pagamento das mensalidades regularizado.	PT	f
103	2	O que é o bilhete diário?	O bilhete diário pode ser adquirido na plataforma SASocial, sendo emitido um bilhete virtual, sem data de validade, que o utilizador deverá validar junto do motorista do autocarro.	PT	f
104	2	O que é a BIRA?	A BIRA é um projeto do IPVC que visa fomentar a mobilidade sustentável através de bicicletas elétricas e convencionais.	PT	f
105	2	Como posso ter uma bicicleta BIRA?	Para aceder ao serviço tem de preencher o formulário de inscrição na plataforma SASocial.	PT	f
106	2	Posso escolher o tipo de bicicleta?	Sim, ao fazer a candiudatura pode optar por uma bicicleta elétrica ou convencional.	PT	f
107	2	Como sei quando vou receber a bicicleta?	Pode acompanhar todo o processo na sua área pessoal da plataforma SASocial Serviço “Bira”.Quando lhe for atribuída a “Bira”, recebe um SMS para aceitar a bicicleta.Depois de aceitar vai receber por e-mail a indicação do dia e hora para levantar a bicicleta, bem como os documentos para assinar.Quando for levantar a bicicleta tem que efetuar o pagamento através da plataforma SASocial.	PT	f
108	2	Tem prazo para alugar a bicicleta?	As bicicletas são alugadas semestralmente, os semestres acompanham os anos letivos.	PT	f
109	2	Só posso alugar a bicicleta no início do semestre?	Não, pode alugar a bicicleta quando quiser, mas paga o valor semestral e tem que entregar a bicicleta no final do semestre em curso.	PT	f
110	2	Quando a bicicleta avaria posso recorrer aos SAS para reparar?	Sim, pode reparar a bicicleta na oficina dos SAS.A reparação é paga pelo utilizador.Os valores das reparações estão definidos na tabela de preços dos SAS, publicada no portal web dos SAS-IPVC.	PT	f
111	2	Como utilizador da bicicleta estou coberto pelo seguro escolar?	Não, o seguro escolar não cobre danos pessoais, tem de fazer um seguro de acidentes pessoais.	PT	f
112	2	O que cobre o seguro das bicicletas?	O seguro tem cobertura contra terceiros e furto. Isto é, cobre danos causados a terceiros e, no caso de furto, a cobertura só aplica se a bicicleta estiver devidamente estacionada e presa com um cadeado.	PT	f
84	2	Que serviços estão incluídos na mensalidade do alojamento?	Os serviços incluídos no valor das mensalidades são: água, luz, internet, aquecimento central, copas para confeção de refeições ligeiras, serviço semanal de mudança da roupa de cama e atoalhados, salas de estudo, salas de convívio, serviço de segurança noturna e serviço de vídeo vigilância. Os danos são analisados caso a caso e havendo lugar a pagamento será aplicada a tabela de preços em vigor.	PT	t
92	2	Como obter as credenciais de acesso para concorrer a bolsa de estudo?	Caso já se encontre a frequentar o ensino superior, mas nunca tenha concorrido a bolsa de estudo, deverá solicitar as suas credenciais de acesso à plataforma da DGES na secção “Requerimentos” na plataforma SASocial.Caso já tenha efetuado candidatura a bolsa de estudo através da plataforma BeOn em ano letivo anterior, poderá utilizar as mesmas credenciais.Caso não tenha solicitado as credencias para candidatura a bolsa de estudo através do concurso nacional de acesso e seja a primeira vez que pretende concorrer à atribuição de uma bolsa de estudo, solicite as suas credenciais após efetuar a matricula no IPVC na secção “Requerimentos” na plataforma SASocial.	PT	t
114	2	Como funciona este chatbot?	Respondo às perguntas mais frequentes sobre os serviços da Ação Social do IPVC. Se precisares de apoio mais específico, posso indicar o contacto ou serviço apropriado.\n\n\n\nKeywords: como funciona, chatbot, ajuda automática, funcionamento, apoio digital, perguntas frequentes	PT	f
113	2	IPVC? Qual é o contacto ?\nComo contactar?  EMAIL SAS?	Podes contactar os Serviços de Ação Social do IPVC através do seguinte e-mail: sas@ipvc.pt ou pelo telefone (+351) 258 819 300.\n\nTambém podes visitar o site oficial: www.sas.ipvc.pt para mais informações.	PT	f
116	2	O que fazes?	Sou o assistente virtual da Ação Social do IPVC. Estou aqui para te ajudar com respostas rápidas sobre serviços como alimentação, alojamento, bolsas de estudo, transportes académicos e bicicletas BIRA.	PT	f
115	2	Que tipo de perguntas posso fazer?	Podes perguntar-me sobre: cantinas e bares, candidatura a alojamento, bolsas de apoio social e de estudo, utilização do Bus Académico, ou como alugar uma bicicleta BIRA. Estou aqui para esclarecer dúvidas sobre os serviços sociais do IPVC.	PT	f
117	3	O que é o EPIC?	O EPIC (Excelência Pedagógica e Inovação em Cocriação) é uma iniciativa que visa promover práticas pedagógicas inovadoras, centradas na cocriação entre docentes, estudantes e comunidade, fortalecendo a qualidade do ensino e aprendizagem.	PT	t
120	3	Quais instituições estão envolvidas no EPIC?	O EPIC é promovido pelo IPVC em parceria com diversas escolas superiores e instituições externas, integrando uma rede colaborativa voltada à inovação no ensino.	PT	f
121	3	Quais são os pilares ou valores do EPIC?	Os pilares do EPIC incluem a cocriação, a excelência pedagógica, a interdisciplinaridade, a inclusão e a sustentabilidade no ensino e aprendizagem.	PT	f
122	3	Quais projetos estão em andamento no EPIC?	O EPIC desenvolve e acompanha diversos projetos pedagógicos inovadores que envolvem metodologias ativas, tecnologias educativas e parcerias externas. A lista atualizada dos projetos em andamento pode ser consultada no site oficial do EPIC.	PT	f
123	3	O que é a Cocriação no contexto do EPIC?	Cocriação no EPIC refere-se à construção colaborativa de práticas pedagógicas entre docentes, estudantes, técnicos e parceiros externos, promovendo o envolvimento ativo de todos no processo de ensino-aprendizagem.	PT	f
119	3	Quem pode participar do EPIC?	Podem participar do EPIC docentes, estudantes, investigadores e técnicos das instituições de ensino envolvidas, bem como parceiros da comunidade externa interessados em cocriação pedagógica.	PT	t
124	3	Como funcionam os laboratórios pedagógicos?	Os laboratórios pedagógicos do EPIC são espaços colaborativos onde se experimentam novas práticas educativas, metodologias inovadoras e tecnologias emergentes, com foco na melhoria contínua do ensino.	PT	f
126	3	O EPIC oferece formações ou oficinas?	Sim, o EPIC organiza regularmente oficinas pedagógicas, workshops e formações sobre metodologias ativas, tecnologias educativas e inovação no ensino.	PT	f
127	3	Onde encontro recursos didáticos ou metodologias inovadoras?	Os recursos desenvolvidos pelo EPIC estão disponíveis na plataforma online, organizados por temas, metodologias e áreas disciplinares, acessíveis a todos os envolvidos na comunidade académica.	PT	f
128	3	Posso participar de algum projeto do EPIC como estudante?	Sim, os estudantes são parte fundamental do EPIC e podem integrar projetos como coautores de soluções pedagógicas, contribuindo com ideias, experiências e participação ativa nas atividades.	PT	f
130	3	Como posso me inscrever em atividades do EPIC?	As inscrições são feitas online, através dos formulários disponíveis no site do EPIC, respeitando os prazos definidos em cada iniciativa ou evento.	PT	f
131	3	Quais são os próximos eventos ou encontros do EPIC?	Os próximos eventos são divulgados no calendário do site do EPIC e nas redes sociais oficiais. A agenda inclui seminários, encontros temáticos, workshops e apresentações de projetos.	PT	f
132	3	Como posso receber novidades e atualizações?	Você pode assinar a newsletter do EPIC ou seguir os perfis oficiais nas redes sociais para receber atualizações sobre eventos, editais, formações e projetos.	PT	f
133	3	O EPIC tem redes sociais ou canal no YouTube?	Sim, o EPIC está presente nas principais redes sociais e possui um canal no YouTube onde são publicados vídeos de eventos, projetos e boas práticas pedagógicas.	PT	f
134	3	Onde posso ver registros de eventos anteriores?	Os registros e materiais de eventos anteriores estão disponíveis no site do EPIC, na secção de Eventos ou Arquivo, incluindo vídeos, atas e apresentações.	PT	f
135	3	Como entro em contato com a equipe do EPIC?	Você pode entrar em contato com a equipa do EPIC através do formulário de contato no site oficial ou pelo endereço de e-mail disponibilizado na secção 'Contactos'.	PT	f
136	3	Tenho uma sugestão. Como posso enviá-la?	As sugestões podem ser enviadas através do formulário específico disponível no site do EPIC ou por e-mail. O programa valoriza a escuta ativa e a melhoria contínua.	PT	f
137	3	Como posso agendar uma reunião ou visita com a equipe EPIC?	Para agendar uma reunião ou visita, entre em contato com a equipa do EPIC pelo site ou e-mail institucional, indicando o objetivo e a disponibilidade de datas.	PT	f
138	3	Como posso submeter um projeto para o EPIC?	A submissão de projetos pode ser feita através dos editais abertos pelo EPIC, disponíveis no site oficial. É necessário preencher o formulário específico e seguir os critérios definidos para avaliação.	PT	f
139	3	Há editais ou chamadas abertas?	Sim, o EPIC publica periodicamente chamadas para submissão de projetos. Consulte a seção de Editais no site do EPIC para verificar as oportunidades em aberto.	PT	f
118	3	Quais são os objetivos do programa EPIC?	Os principais objetivos do EPIC incluem fomentar a inovação pedagógica, promover a colaboração interdisciplinar, estimular a participação ativa dos estudantes e valorizar as boas práticas no ensino superior.	PT	t
125	3	Como os professores podem se envolver?	Os docentes podem participar submetendo projetos, integrando equipas multidisciplinares, frequentando oficinas de formação e colaborando com os laboratórios pedagógicos promovidos pelo EPIC.	PT	t
129	3	Há certificação para quem participa dos projetos?	Sim, o EPIC emite certificados de participação para estudantes, docentes e parceiros que integrem e contribuam com os projetos e atividades promovidas pelo programa.	PT	t
